    false,nt"url": null,nt"notes": "This data set contains the 1995 - 2005-era
    classifications of US Gulf Coast, zone 37 and zone 46 and can be used to analyze
    change. This imagery was collected as part of the Multi-Resolution Land Characteristics
    program in a multi-agency effort to provide baseline multi-scale environmental characteristics
    and to monitor environmental change. The data set utilized 42 (zone 37) and 72 (zone
    46) full or partial Landsat 5 and 7 scenes which were analyzed according to the
